import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import ClienteBusqueda from "./components/ClientesBusqueda/ClientesBusqueda";
import "@fontsource/roboto/300.css";

function App() {
    <BrowserRouter>
        <Routes>
            <Route></Route>
        </Routes>
    </BrowserRouter>;
    return (
        <div className="App">
            <ClienteBusqueda />
        </div>
    );
}

export default App;
